// Native modules import
import React, { Component } from 'react'

class Signup extends Component {
  constructor() {
    super()
    this.state = {
      name: "",
      email: "",
      password: "",
      error: "",
    }
  }
  render() { 
    return (
      <div className="container">
        <h2 className="mt-5 mb-5">Cr√©ation de compte</h2>
        <form action="">
          <div className="form-group">
            <label htmlFor="Name" className="text-muted">Pseudo</label>
            <input type="text" className="form-control"/>
          </div>
          <div className="form-group">
            <label htmlFor="Email" className="text-muted">E-mail</label>
            <input type="text" className="form-control"/>
          </div>
          <div className="form-group">
            <label htmlFor="Password" className="text-muted">Mot de passe</label>
            <input type="text" className="form-control"/>
          </div>
          <button type="submit" className="btn btn-raised btn-primary">Envoyer</button>
        </form>
      </div>
    )
  }
}
 
export default Signup;
